g2:c.PROCEDURE.g2:a.TEXT:
shakespeare-get-speech(phrase: text, endpoint-name: text, result-field: symbol)
endpoint-reference: structure = structure(
  service-namespace: "http://xmlme.com/WebServices",
  service-name: "Shakespeare",
  endpoint-name: endpoint-name);
operation-name: text = "GetSpeech";
input-message: structure = structure(-REQUEST: phrase);
output-message: structure;
speech: text;
begin
  output-message = call g2-invoke-web-service-operation(endpoint-reference, operation-name, input-message);
  speech = the text that is an attribute of output-message named by result-field;
  post "[speech]";
end

g2gl-shakespeare-get-speech(phrase: text)
ret-vals: sequence;
success-p: truth-value;
begin
  ret-vals, success-p = call g2-call-g2gl-process-as-procedure(shakespeare-process, sequence(phrase));
  if success-p then
    post "[ret-vals[0]]";
end

remove-whitespace(tree: sequence) = (sequence)
i: integer;
x: value;
children: sequence;
match: structure;
begin
  for i = (the number of elements in tree) - 1 down to 0 do
    x = tree[i];
    if x is a structure and the children of x exists then begin
      children = call remove-whitespace(the children of x);
      x = change-attribute(x, children, children);
      tree = change-element(tree, i, x);
    end else if x is a text then begin
      match = find-next-pattern("^<whitespace>*", x, 1);
      if ((the end-index of match) = length-of-text(x)) then begin
        tree = remove(tree, i);
      end;
    end;
  end;
  return tree;
end

import(URL: text, item: class item)
description: class web-service-description;
begin
  description = call g2-import-web-service-description(URL);
  transfer description to the workspace of item at (the item-x-position of item, the item-y-position of item - 50);
end

weather-forecast-get-weather-by-zip-code(zip-code: text, endpoint-name: text, result-field: symbol)
endpoint-reference: structure = structure(
  service-namespace: "http://www.webservicex.net",
  service-name: "WeatherForecast",
  endpoint-name: endpoint-name);
operation-name: text = "GetWeatherByZipCode";
input-message: structure = structure(-ZIP-CODE: zip-code);
output-message: structure;
weather: sequence;
begin
  output-message = call g2-invoke-web-service-operation(endpoint-reference, operation-name, input-message);
  weather = call remove-whitespace(the value that is an attribute of output-message named by result-field);
  post "[weather]";
end

google-search-service-do-google-search(search-text: text)
URL: text = "http://ajax.googleapis.com/ajax/services/search/web?v=1.0&q=[search-text]";
response: structure;
body-entries: text;
begin
  post "HTTP request:[URL]";
  response = call g2-send-web-request(URL, structure());
  body-entries = call g2-read-http-entity-body(response);
  post "HTTP response:[body-entries]";
end

echo-dispatch(server: class http-server, request: structure) = (structure)
path: sequence = the path of request;
filestring: text;
response: structure;
begin
  post "Echo server received:
[request]";
  if path = sequence("soap") then
    response = call g2-handle-http-request-as-soap(server, request, soap-echo, request)
  else if path = sequence("echo") then
    response = call http-echo(request)
  else if the number of elements in path = 2 and path[0] = "g2gl" then 
    response = call handle-g2gl-message(symbol(path[1]), request)
  else begin
    filestring = call resolve-http-request-path(path, server-root);
    response = call handle-http-request-from-file(server, request, filestring)
  end;
  post "Echo server replied:
[response]";
  return response
end

soap-echo(server: class http-server, request: structure, user-data: item-or-value) = (structure)
header-entries: sequence = sequence();
begin
  if the header-entries of request exists then header-entries = the header-entries of request;
  return structure(body-entries: sequence(
    structure(tag-name: "action", attributes: structure(uri: the action of request)),
    structure(tag-name: "header-entries", children: header-entries),
    structure(tag-name: "body-entries", children: the body-entries of request)));
end

send-soap-echo-request()
URL: text = "http://localhost:[the http-server-port of echo-server]/soap";
request: structure = structure(
  action: "http://gensym.com/soap-echo",    
  body-entries: sequence(structure(tag-name: "testing", children: sequence("123"))));
response: structure;
body-entries: sequence;
begin
  post "SOAP echo request:
[request]";
  response = call g2-send-soap-request(URL, request);
  body-entries = call remove-whitespace(the body-entries of response);
  post "SOAP echo response:
[body-entries]";
end

read-http-entity-chunk-from-stream(response: structure) = (sequence)
chunk: sequence;
chunk-size: integer = 4096;
stream: class g2-stream = the user-data of response;
begin
   if the g2-stream-status of stream = the symbol end-of-file-reached then
     begin
       call g2-close-file(stream); 
       return sequence();
     end;
  chunk = call g2-read-bytes-as-sequence(stream, chunk-size);
  return chunk;
end

handle-http-request-from-file(server: class http-server, request: structure, filestring: text) = (structure)
directory-p, exists-p: truth-value;
stream: class g2-stream;
begin
  directory-p = call g2-directory-exists(filestring);
  if directory-p then begin
    // TO DO: look for index.html, or produce directory page
    return structure(status-code: 403, headers: structure(Content-Type: "text/plain"), entity: "403 Forbidden");
  end;
  exists-p = call g2-file-exists(filestring);
  if exists-p then begin
    stream = call g2-open-file-for-read(filestring);
    return structure(entity-producer: read-http-entity-chunk-from-stream, user-data: stream);
  end;
  return structure(status-code: 404, headers: structure(Content-Type: "text/plain"), entity: "404 Not Found");
end

resolve-http-request-path(path: sequence, root: text) = (text)
path-len: integer = the number of elements in path;
path-dir-seq: sequence = remove(path, path-len - 1);
path-file: text = path[path-len - 1];
host, device, directory, base-name, extension, version: text;
dir-list: class text-list;
filestring: text;
begin
  host, device, directory, base-name, extension, version = call g2-partition-filestring(root);
  dir-list = call g2-file-directory-string-to-list(directory);
  conclude that the g2-list-sequence of dir-list = concatenate(the g2-list-sequence of dir-list, path-dir-seq);
  directory = call g2-file-directory-list-to-string(dir-list);
  filestring = call g2-collect-into-filestring(host, device, directory, path-file, "", "");
  delete dir-list;
  return filestring;
end

handle-g2gl-message(operation-name: symbol, request: structure) = (structure)
response: structure;
begin
  response = call g2-invoke-g2gl-operation(g2gl-standard-service-switch, operation-name, structure(query: the query of request));
  return structure(headers: structure(Content-type: "text/plain"), entity: the entity of response);
end
